Ad.ze V.le G. da Cermenate/Navigli - Via PalmieriProponiamo, a pochi minuti a piedi dagli storici Navigli, una soluzione immobiliare in stile loft, sita al piano terra di una palazzina risalente agli anni ’50 con servizio di portineria, di mq 75 c.a composta così come segue:PIANO TERRA: zona living, cucina abitabile, bagno con box doccia;
PIANO SOPPALCO: camera da letto, studio/seconda camera, cabina armadio;
PIANO INTERRATO: locale hobby/deposito.
L’appartamento è stato recentemente ristrutturato ed è in ottimo stato manutentivo (nota bene: parte degli arredi visibili in foto sono stati cambiati).Il riscaldamento è AUTONOMO ed è presente l’impianto di aria condizionata.Per vedere maggiori foto dell'immobile, visita il nostro sito www.imi.it
